import React from "react";
import { BrowserRouter as Router, Route, Routes, NavLink } from "react-router-dom";
import History from '../components/History';
import Team1 from '../components/Team1';
import Team2 from '../components/Team2';

function Header() {
    return (
        <header>
            <div className="logo-container">
                <img
                    src="https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG"
                    alt="AC Milan Logo"
                    className="logo-img"
                />
                <span className="logo-text">AC Milan</span>
                <ul className="nav">
                    {/* Використання NavLink для переходу на сторінку історії */}
                    <li><NavLink to="/history" activeClassName="active"> Про клуб </NavLink></li>
                    <li><NavLink to="/old_team" activeClassName="active"> Основна команда </NavLink></li>
                    <li><NavLink to="/new_team" activeClassName="active"> Молодіжна команда </NavLink></li>
                </ul>
            </div>
            <div className="presentation"></div>
            <Router>
                <Routes>
                    <Route exact path="/history" element={<History />} />
                    <Route exact path="/old_team" element={<Team1 />} />
                    <Route exact path="/new_team" element={<Team2 />} />
                </Routes>
            </Router>
        </header>
    );
}

export default Header;
